import React from "react";
import BookItem from "./BookItem";

const List = (props) => {
    if (props.items.length === 0) {
        return <h2>Found no books.</h2>
    }

    return (
        <ul>
            {props.items.map((book) => (
                <Book
                    key={book.id}
                    title={book.title}
                    author={book.author}
                    publicationDate={book.publicationDate}
                    genre={book.genre} 
                />
            ))}
        </ul>
    );
}

export default List;
